import styled from "styled-components";
import logo_img_acima from "../../assets/img/logo-img-acima.svg";

export default function Enroll() {
  return (
    <Wrapper>
      <Logo src={logo_img_acima} alt="Cine-book club logo" />
    </Wrapper>
  );
}

const Wrapper = styled.div`
  background-color: #ffd7ba;
  display: flex;
  align-items: center;
  justify-content: center;
  width: 100vw;
  height: 100vh;
`;

const Logo = styled.img`
  background-color: #ffd7ba;
`;
